import React from "react";
import logos from "../img/logos.png";
import './Main2.css'


const Main2 = () => (
<div class="main">
    <div class="text">
<div class="lnb">
    
        </div>
        <img class="logos"src={logos} alt="logos"/>
        본 활동은  프로젝트 활동으로, 비공식 홈페이지 입니다. 온라인 청년센터(정부)와 관련없습니다.
</div>
</div>
)

export default Main2;
